import React from "react";
import './Intro.css';
import Github from '../../img/github.png';
import LinkedIn from '../../img/linkedin.png';
import Instagram from '../../img/instagram.png';
import Vector1 from '../../img/Vector1.png';
import Vector2 from '../../img/Vector2.png';
import Boy1 from '../../img/boy1.png';
import Crown from '../../img/crown.png';
import glassesimoji from '../../img/glassesimoji.png';
import { FloatingDiv } from "../FloatingDiv/FloatingDiv";


export const Intro = () => {
    return(
        <div className="intro">
            <div className="i-left">
                <div className="i-name">
                    <span>Olá! Eu Sou</span>
                    <span>David Edson</span>
                    <span>
                        Desenvolvedor Front-end com alto nível de 
                        experiência em web design e desenvolvimento, 
                        produzindo um trabalho de qualidade!
                    </span>
                </div>
                <button className="button i-button">Contrate-me</button>
                <div className="i-icons">
                    <a href="https://github.com/devdavidedson" target={'_blank'}>
                        <img src={Github} alt="github-icon" />
                    </a>
                    <a href="https://www.linkedin.com/in/devdavidedson/" target={'_blank'}>
                        <img src={LinkedIn} alt="linkedin-icon" />
                    </a>
                    <a href="https://www.instagram.com/dmi.atelie/" target={'_blank'}>
                        <img src={Instagram} alt="insta-icon" />
                    </a>
                </div>
            </div>
            <div className="i-right">
                <img src={Vector1} alt="" />
                <img src={Vector2} alt="" />
                <img src={Boy1} alt="" />
            <div>
                <FloatingDiv image={Crown} txt1/>
            </div>
            </div>
        </div>
    );
}
